import React from 'react';
import {StyleCard} from './Style'
import Product from '../Product'

function Card ({propertyProp}){
    const {image, _id} = propertyProp;
    return(
        <StyleCard>
            <Product key={propertyProp._id} product={propertyProp} />
        </StyleCard>
    )
}

export default Card
